import React from "react";
import "./Event_Task.css";
import { useSelector } from "react-redux";

const worker = new Worker("Worker.js");
worker.postMessage("Worker is working!");

export default function Event_Task() {
    // тут должен был быть компонент               
    const list = useSelector(state => state.data)
    console.log(list)
    return (
        <section className='Event_Task'>
            {list.map((item)=> {
                <div className="Event_Task_plate">
                    <div className="Event_Task_textplate">
                    <div className="Event_Task_title">{item.title}</div></div></div>
            })}
        </section>
    )
}
